Plot
If love is an adventure, it's one yet to be embarked upon by Kenya Denise McQueen. A beautiful L.A. career woman, Kenya works as senior manager at a prestigious accounting firm, and is on the verge of making partner. But she has yet to find her own partner and a fulfilling personal life. It's not that she's stopped looking; her (mental) checklist is at the ready. After another Valentine's Day spent working late, Kenya agrees to a blind date with Brian Kelly, a sexy and free-spirited landscape architect who turns out to be not exactly what she'd pictured for herself. Then again, she does need the yard of her new house fixed up. Her girlfriends Cheryl, Suzzette, and Nedra are there for her with advice, while Cheryl's new beau Walter shares a male perspective with Brian. Kenya's socially prominent parents Joyce and Edmond and womanizing younger brother Nelsen also voice their own opinions. But it's when her perfect match, Mark, enters the picture that Kenya is truly thrown into confusion. Ultimately, Kenya has to decide for herself and follow herheart--no matter where it takes her.
